import React from "react";

function InfoTooltip (props) {
    console.log(props.isS)
    return (
        <div className={`popup ${props.isOpen && `popup_opened`}`} id={props.name}>
            <div className="popup__container">
                <div className="popup__mark"></div>
                <h2 className="popup__title popup__title_mark">Вы успешно зарегистрировались!</h2>
                <button className="popup__button-exit" type="button"
                    onClick={props.onClose}></button>
            </div>
        </div>
    )
}

export default InfoTooltip;
